    "edges": [
        {"source": src, "target": tgt, "attributes": {"Drug ID": drug_id, "Drug Name": info['drug_name']}}
        for drug_id, info in drug_to_receptors.items() for src, tgt in combinations(set(info['receptors']), 2)
    ]
}

